const JSON = json_input;
const NO_OWNER_EMAIL = "emil@cloudcoreo.com";
const OWNER_TAG = "NOT_A_TAG";
const ALLOW_EMPTY = "false";
const SEND_ON = "change";
const AUDIT_NAME = 'ec2-samples';


const ARE_KILL_SCRIPTS_SHOWN = true;
const EC2_LOGIC = "or"; // you can choose 'and' or 'or';
const EXPECTED_TAGS = ["EXAMPLE_TAG_1", "EXAMPLE_TAG_2"];
const WHAT_NEED_TO_SHOWN = {
    OBJECT_ID: {
        headerName: 'AWS Object ID',
        isShown: true,
    },
    REGION: {
        headerName: 'Region',
        isShown: true,
    },
    AWS_CONSOLE: {
        headerName: 'AWS Console',
        isShown: true,
    },
    TAGS: {
        headerName: 'Tags',
        isShown: true,
    },
    AMI: {
        headerName: 'AMI',
        isShown: false,
    },
    KILL_SCRIPTS: {
        headerName: 'Kill Cmd',
        isShown: false,
    }
};


const VARIABLES = {
    NO_OWNER_EMAIL,
    OWNER_TAG,
    AUDIT_NAME,
    ARE_KILL_SCRIPTS_SHOWN,
    EC2_LOGIC,
    EXPECTED_TAGS,
    WHAT_NEED_TO_SHOWN,
    ALLOW_EMPTY,
    SEND_ON
};



const CloudCoreoJSRunner = require('cloudcoreo-jsrunner-commons');
const AuditEC2ATK = new CloudCoreoJSRunner(JSON, VARIABLES);
const notifiers = AuditEC2ATK.getNotifiers();
callback(notifiers);

